import { MovingPortfolioContainer, RedHeaderBox } from '../lib/container'
import { BoxHeader } from '../lib/text'

export const Skills = () => {
  return (
    <MovingPortfolioContainer>
      <RedHeaderBox>
        <BoxHeader>SKILLS</BoxHeader>
      </RedHeaderBox>
    </MovingPortfolioContainer>
  )
}

export default Skills
